import axios from "axios";

const baseUrl = "https://elephant-api.herokuapp.com";

export const getAllElephants = () => {
  const requestConfig = {
    headers: {
      "Access-Control-Allow-Origin": "https://elephant-api.herokuapp.com/",
    },
  };

  return axios.get(`${baseUrl}`, requestConfig);
};
